import React from "react";

function TableComponent({ results }) {
    
    debugger
  return (
    <div className="table-container">
      <table>
        <thead>
          <tr>
            <th>Image</th>
            <th>Name</th>
            <th>Gross Price</th>
            <th>Gross Unit Price</th>
          </tr>
        </thead>
        <tbody>
          {results.map((item, index) => (
            <tr key={index}>
              {/* Image column */}
              <td>
                <img style={{ width: item.thumbnail.width, height: item.thumbnail.height, objectFit: "contain" }}  src={item.thumbnail.url} alt={item.name} />
              </td>
              {/* Name column */}
              <td>{item.name}</td>
              {/* Gross Price column */}
              <td>{item.gross_price}</td>
              {/* Gross Unit Price column */}
              <td>{item.gross_unit_price}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default TableComponent;
